Razões da Escolha do Imóvel:
Localização privilegiada, de fácil acesso por transporte público e próximo a unidades de saúde e equipamentos sociais;

Imóvel já adaptado ou com mínima necessidade de adequações estruturais;
Custo compatível com os valores praticados no mercado imobiliário local;
Disponibilidade imediata para ocupação, atendendo à urgência da implantação do serviço.

A presente justificativa tem por objetivo fundamentar a contratação direta, por dispensa de licitação, para a locação de imóvel urbano destinado à instalação e funcionamento do Centro de Especialidades Odontológicas (CEO), no âmbito da rede municipal de saúde.

2. Fundamentação Legal:
Nos termos do artigo 74, inciso X, da Lei nº 14.133/2021, é dispensável a licitação quando se tratar de “aquisição ou locação de imóvel cujas características de instalação e de localização tornem necessária sua escolha, condicionada a avaliação prévia de seus custos e à justificativa de escolha do imóvel”.

3. Justificativa Técnica e Administrativa:
A implantação e manutenção de um Centro de Especialidades Odontológicas (CEO) são estratégias fundamentais para a ampliação do acesso da população aos serviços odontológicos especializados, conforme diretrizes do Ministério da Saúde. Para tanto, a unidade precisa dispor de um espaço físico adequado para abrigar consultórios odontológicos, recepção, salas de espera, esterilização, expurgo, ambientes administrativos e banheiros acessíveis, além de atender aos seguintes critérios:
Localização estratégica e central, de fácil acesso à população e servidores;
Área útil suficiente para abrigar a estrutura técnica mínima exigida pelo Ministério da Saúde;
Condições estruturais adequadas e compatíveis com os parâmetros da vigilância sanitária (RDC nº 50/2002 – ANVISA);
Conformidade com as normas de acessibilidade (Lei nº 13.146/2015 – Estatuto da Pessoa com Deficiência);
Possibilidade de instalação dos equipamentos odontológicos com segurança elétrica e hidráulica.
